export interface IAcmReport {
  activeTabIndex?: number;
  appId?: string;
  appCode?: string;
  groupBy?: string;
}

export class AcmReport implements IAcmReport {
  constructor(public activeTabIndex?: number, public appId?: string, public appCode?: string, public groupBy?: string) {
    this.activeTabIndex = 0;
  }
}

export const UserGroups: any = [
  {
    label: 'Group',
    value: 'Group',
  },
  {
    label: 'Role',
    value: 'Role',
  },
];

export const RoleGroups: any = [
